-- ########################################################
--
-- Aktualisieren der Daten an Zeitpunkt des Seminars
-- 
-- ########################################################

USE semSSDT
GO


PRINT 'Anpassen der Datumswerte';

DECLARE @Jahr As int,
		@Diff As int 
 
-- Ältestes Jahr ermitteln
SELECT @Jahr = MAX(Year(Auftragsdatum)) FROM dbo.Auftraege;
SELECT @Diff = Year(Getdate()) - @Jahr;

-- Datumswerte anpassen
UPDATE dbo.Auftraege
SET Auftragsdatum = DATEADD(YEAR, @Diff, Auftragsdatum);

-- In der Zukunft liegende Datumswerte wieder löschen
UPDATE dbo.Auftraege SET Auftragsdatum = NULL WHERE Auftragsdatum > GETDATE();

-- Bestellungen ohne Bestelldatum löschen
DELETE FROM dbo.Auftragspositionen
 WHERE AuftragID IN (SELECT AuftragID FROM dbo.Auftraege WHERE Auftragsdatum Is Null);
DELETE FROM dbo.Auftraege WHERE Auftragsdatum Is Null;

PRINT 'Fertig'


GO
